description:
 Life is rather boring in a sleepy New England town, the annual 'highlight' being the witchcraft-themed carnival. One year, a gang of women friends awake ancient dark powers by throwing coins into the wishing well. Then arrives wealthy, irresistible Darryl Van Horne, who buys the only grand estate and half the town's businesses. He charms the girls and there lives turn around.

